import React, { useEffect, useState } from 'react'
import { useSelector, useDispatch } from 'react-redux'
import axios from 'axios'
import { Context } from '../pages/Store'

const Blog = () => {
  const dispatch = useDispatch()
  var counter = ''
  var error = ''

  useEffect(() => {
    axios
      .get('https://ws.med.tn/web/doctorInfos/?api_key=drmater')
      .then(response => {
        dispatch({
          type: 'SET_POSTS',
          payload: Object.values(response)[0],
        })
      })
      .catch(error => {
        dispatch({ type: 'SET_ERROR', payload: error })
      })
  }, [])
  useSelector(state =>
    state && state.posts != undefined
      ? (counter = state.posts)
      : state && (error = state.error)
  )

  console.log('state.errr', error)

  console.log('state.counter', counter)

  return counter ? (
    <div>
      {counter && counter[0].id_doctor != undefined
        ? counter[0].id_doctor
        : null}
    </div>
  ) : (
    <p>
      Something went wrong: <span>{error && error}</span>
    </p>
  )
}

export default Blog
